			var cirImg = function() {
			this.init();
		//	this.bindEvents();
		};
		
		cirImg.prototype= {
			init: function() {
				var canvas1 = document.createElement("canvas");
				canvas1.setAttribute('width', '190');
				canvas1.setAttribute('height', '150');
				canvas1.style.position = 'absolute';
				canvas1.style.top = '0';
				canvas1.style.left = '0';
				canvas1.id = 'testCircle';
		
				document.getElementsByTagName('body')[0].appendChild(canvas1);
		
				var canvas = document.getElementById('testCircle');
				if (!canvas.getContext && typeof FlashCanvas != "undefined") {
		    		FlashCanvas.initElement(canvas);
				}
				var context = canvas.getContext('2d');
				var centerX = canvas.width / 2;
				var centerY = canvas.height / 2;
				var radius = 50;
		
				context.beginPath();
				context.arc(centerX, centerY, radius, 0, 2 * Math.PI, false);
				context.lineWidth = 2;
				context.strokeStyle = '#003300';
				context.stroke();
				
				var imageObj = new Image();
				imageObj.src = '../demos/images/rdj.png';
		
				imageObj.onload = function() {
				    context.save();
				    context.beginPath();
				    context.arc(centerX, centerY, radius, 0, Math.PI * 2, true);
				    context.closePath();
				    context.clip();
				
				    context.drawImage(imageObj, 0, 0, canvas.width, canvas.height);
				
				    context.beginPath();
				    context.arc(centerX, centerY, radius, 0, Math.PI * 2, true);
				    context.clip();
				    context.closePath();
				    context.restore();
				};
